Let's test the matchmaker webservice without a game client. Open up your browser to http://localhost:3000 so the page has the correct security context. Find the developer tools console, and paste in this javascript to simulate a real client asking for a match over a websocket connection: const ws = new WebSocket("ws://localhost:3000/matchmaker/ws"); ws.onopen = () => { console.log("Connected to WebSocket"); const payload = { client_ip: "81.128.157.123", game: "bevygap-spaceships", version: "1" }; ws.send(JSON.stringify(payload)); console.log("Sent payload:", payload);
}; ws.onmessage = (event) => { console.log("Received message:", event.data);
}; ws.onclose = () => { console.log("WebSocket connection closed");
}; Websocket test in browser If that worked, you will notice a new deployment is running in the Edgegap dashboard, and a new Edgegap session is active. After a minute or so, the matchmaker will realise that no game client ever consumed that connect token, and delete the Edgegap session. After 10 minutes of no sessions linked to the deployment, Edgegap will stop the deployment. Feel free to manually terminate it now.

