Install mkcert Find the directory where mkcert puts its CA certificate. On my mac, this looks like: $ mkcert -CAROOT
/Users/rj/Library/Application Support/mkcert # Check for the rootCA.pem file:
$ ls "/Users/rj/Library/Application Support/mkcert"
rootCA-key.pem rootCA.pem # <-- this one Now generate a certificate for your NATS server: $ mkcert -cert-file nats-server-cert.pem -key-file nats-server-key.pem localhost ::1 nats Make a nats-config directory, and copy the server certificate and key into it: $ mkdir nats-config
$ mv nats-server-cert.pem nats-server-key.pem ./nats-config/ When we run the NATS server in docker, we'll ensure this nats-config directory is available at /config inside the container. With this in mind, we create a nats-server.conf file that references the server certificate, and creates some username/password pairs. Don't forget to create real passwords before exposing this to the internet. Create nats-config/nats-server.conf: listen: 0.0.0.0:4222 authorization: { users: [ {user: "matchmaker", password: "matchmaker"}, {user: "matchmaker_httpd", password: "matchmaker_httpd"}, {user: "gameserver", password: "gameserver"}, ]
} tls { cert_file: "/config/nats-server-cert.pem" key_file: "/config/nats-server-key.pem"
} jetstream { # storage directory will be mapped for you by docker: store_dir: /data # 100MB = high but sane limits, which we don't expect to hit: max_memory_store: 104857600 max_file_store: 104857600
} For a NATS client to connect, they will need the CA cert which signed the NATS server certificate, ie the rootCA.pem file â€“ to verify the server's certificate. We'll ship this file in the gameserver docker image, and make it available to the matchmaker and other services that establish NATS connections. Self-signed vs Trusted CAs This can all be avoided if you use a certificate authority that is already trusted, such as LetsEncrypt. In my deployment, my NATS server reuses a certificate generated for my domain name by Traefik, which is already trusted by browsers and the NATS clients. No difference in 'how secure', and this tutorial will assume we use self-signed for now.
